ads.description:
Witam, 



Mam do sprzedania auto Citroen C4 Picasso w bogatej wersji Exclusive, wyposażony w niezawodny silnik 2.0 HDi, który doskonale sprawdza się zarówno w warunkach miejskich, jak i podczas dłuższych tras. Przebieg samochodu to 329 000 km.



Samochód ma ważne ubezpieczenie OC do 05.2026 i wymieniony rozrząd.



Wnętrze to ciemna tapicerka, wyjątkowo praktyczna z punktu widzenia dzieci. 



Wyposażenie pojazdu obejmuje m.in.:



-sprawną klimatyzację automatyczną wielostrefową;

-oryginalne radio;

-dobrej jakości nagłośnienie;

-elektryczne szyby;

-elektryczne lusterka;

-zamek centralny;

-ESP;

-ABS;

-koło zapasowe;

-elektryczny hamulec ręczny;

-automatyczną skrzynię biegów;

-klimatyzowany schowek;

- za dopłatą, zestaw opon zimowych na stalowych felgach + możliwość zakupu relingów dachowych.



Auto wymaga drobnych poprawek lakierniczych w obszarze nadproży.
